import React from 'react'
import { Link } from 'react-router-dom';

export default function APSubMenu() {
  return (
    <div className='apsub'>
        <ul>
            <li>
                <Link to="/create-id-card">Đăng ký CCCD</Link>
            </li>
            <li>
                <Link to="/create-passport">Đăng ký Hộ chiếu</Link>
            </li>
        </ul>
    </div>
  )
}
